(1, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'Buena actitud, buen desempeño y manejo de casos y conocimientos.', 'estudio para mejorar conocimiento', 111, '174'),
(2, 3, 3, 3, 3, 3, 3, 3, 2, 3, 2, 3, 31, 'DESEMPEÑO BUENO', 'buena actitud y disposicion.', 'mejorar conocimiento en el ERP asi como documentar las incidencias. Estar al pendiente de las actividades', 168, '174'),
(3, 3, 3, 3, 2, 3, 4, 4, 3, 3, 2, 3, 33, 'DESEMPEÑO BUENO', 'buena comunicación con el equipo.\r\nExcelente conocimiento de temas contables y fiscales', 'Mayor documentación.\r\nRealizar minutas y llevar  mejor seguimiento.\r\nAvanzar en certificación', 172, '174'),
(4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'buen conocimiento contable.\r\nbuena actitud de servicio.\r\n', 'Mayor conocimiento del sistema.\r\nMejorar la documentación.\r\nMejorar la planificación de las actividades.\r\nRealizar y enviar minutas.\r\n', 159, '174'),
(5, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', '.', '.', 96, '68'),
(6, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'Tiene buen servicio al cliente, se ve comprometido con su trabajo y tiene buen trabajo en equipo', 'Le hace falta trabajar un poco en la comunicacion ', 126, '68'),
(7, 4, 4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 35, 'DESEMPEÑO BUENO', 'Tiene buen servicio al cliente, se ve comprometido con su trabajo y tiene buena comunicacion', 'Le hace falta un poco de planeacion u organizarse mejor y mejorar su puntualidad en las juntas', 147, '68'),
(8, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'Tiene buen servicio al cliente, se ve comprometido con su trabajo y tiene buena comunicacion', 'Le hace falta un poco de planeacion u organizarse mejor', 94, '68'),
(9, 3, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 34, 'DESEMPEÑO BUENO', 'Explicación propia\r\nAuto estudio', 'Miedos al frente del cliente \r\nConfianza mas en ella', 187, '151'),
