(98, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 33, 'DESEMPEÑO BUENO', 'Autodidacta y propone soluciones novedosas', 'Comunicación verbal', 323, '40'),
(99, 3, 3, 3, 4, 3, 3, 3, 3, 3, 4, 3, 35, 'DESEMPEÑO BUENO', 'Detallista\r\nMeticulosa\r\nOrdenada\r\nRespetuosa\r\nCuriosa\r\nPropone nuevas maneras de hacer las cosas\r\nAporta diferentes formas de hacer las cosas considerando sus experiencias', 'No detecto una habilidad en este momento que puedira dejar en observación puesto que está en un proceso de adaptación a las formas particulares de esta empresa en la implementación de un sistema tipo ERP. \r\n\r\nEstaré revisando en adelante cómo avanza su proceso de adaptación y aprendizaje de ómo se hacen las cosas en Netsoft / Cloud Suite', 348, '29'),
(100, 4, 4, 3, 3, 4, 4, 4, 3, 3, 3, 3, 38, 'LLENAR FORMULARIO', '.', '.', 79, '40'),
(101, 3, 3, 3, 3, 3, 2, 3, 3, 3, 3, 3, 32, 'DESEMPEÑO BUENO', 'TEST', 'TEST', 390, '40'),
(102, 2, 2, 2, 2, 2, 2, 3, 3, 3, 2, 3, 26, 'DESEMPEÑO BUENO', '\r\nEscucha atento a los demás\r\nRespeto mutuo\r\n', 'Liderazgo\r\norientación a resultados', 367, '52'),
(103, 2, 3, 3, 4, 2, 2, 3, 3, 3, 3, 3, 31, 'DESEMPEÑO BUENO', '1', '01', 371, '3');
