(3, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 2, 36, 'DESEMPEÑO REGULAR', 'fdsf', 'fdsgfgh', 10, '3'),
(4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 4, 72, 'EXCELENTE DESEMPEÑO', 'd', 'd', 305, '3'),
(5, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 55, 'DESEMPEÑO BUENO', 'Iván es una persona responsable orientada al cumplimiento de los objetivos del proyecto y del cliente; siempre tiene buena disposición a colaborar con los compañeros, ya sea del proyecto al que está asignado o a otros que se lo solicitan.', 'Debe trabajar en el aprendizaje de módulos avanzados y centrarse en perfeccionar los que ya conoce.', 189, '159'),
(6, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 54, 'DESEMPEÑO BUENO', 'Compromiso, responsabilidad y orientación a resultados.', 'Adquirir nuevos conocimientos sobre módulos avanzados.', 134, '159'),
(7, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 54, 'DESEMPEÑO BUENO', 'Trabajo en equipo, integridad, empatía y compromiso', 'Adquirir nuevos conocimientos de módulos avanzados.', 251, '159'),
(8, 3, 3, 3, 2, 2, 3, 1, 3, 2, 2, 1, 2, 3, 1, 2, 2, 2, 3, 40, 'DESEMPEÑO REGULAR', '-Habilidad de Comunicacion con el cliente \r\n-Trabajo en Equipo', '-Cumplir en tiempo y forma con sus actividades', 88, '127'),
(9, 4, 4, 4, 3, 3, 2, 3, 4, 4, 2, 2, 3, 3, 2, 2, 2, 2, 3, 52, 'DESEMPEÑO BUENO', '- Buenas habilidades de comunicacion y trabajo en equipo\r\n- Actitud de solucionar y buscar opciones aunque los conocimientos técnicos aun no sean una fortaleza', 'Mejorar la entrega en tiempo de las asignaciones', 341, '127'),
(10, 4, 3, 3, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 54, 'DESEMPEÑO BUENO', 'Compromiso y Responsabilidad propia y con el equipo', 'Los conocimientos técnicos que no se tienen, es preferible consultar antes que dar respuestas u opiniones al cliente que puedan poner en peligro las tareas de la implementación', 375, '127'),
(11, 3, 2, 3, 3, 2, 3, 3, 4, 4, 2, 2, 3, 3, 3, 3, 3, 2, 3, 51, 'DESEMPEÑO BUENO', 'Buena actitud para el trabajo en Equipo \r\nHabilidades de comunicación con cliente', 'Seguir instrucciones del Lider de Proyecto', 378, '127'),
(12, 3, 3, 3, 3, 2, 2, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 52, 'DESEMPEÑO BUENO', 'Trabajo en equipo, compromiso y responsabilidad.', 'Seguir desarrollando los valores organizacionales sobre todo los centrados en el cliente.', 191, '159'),
(13, 3, 3, 3, 3, 4, 3, 3, 3, 3, 3, 3, 3, 3, 4, 3, 3, 3, 4, 57, 'DESEMPEÑO BUENO', 'Trabajo en equipo, responsabilidad, compromiso e integridad.', 'Continuar trabajando en el desarrollo de los valores organizacionales. ', 44, '159'),
(14, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 3, 2, 1, 51, 'DESEMPEÑO BUENO', 'Trabajo en equipo, responsabilidad y compromiso.', 'Seguir perfeccionando los valores organizacionales.', 43, '159');
